import React, { useContext } from 'react';
import { ErrorMessage, Field, Form, Formik } from 'formik';
import { ThemeContext } from '../../context/index';
import SignUpForm from '../../components/SignUpForm';
import styles from './SingUpPage.module.scss';



const SignUpPage = () => {
  const {useSetClassName} = useContext(ThemeContext);
  const {classNamePage} = useSetClassName();
  return (
     <div className={classNamePage()}>
      <div className='styles.containerSingUp'>
    <Formik onSubmit={()=>{}} initialValues={{name:'body'}}>
        <Form>
          <ErrorMessage/>
          <Field name='body'/>
        </Form>
      
   
    </Formik>
      </div>
   {/* <SignUpForm/> */}
   </div>
  );
}

export default SignUpPage;
